import "./UserDatas.css";
import React from "react";


const UserDatas = (props) =>{

    console.log(typeof props.userdata)
    console.log(props.userdata[0])
    console.log(Object.values( props.userdata))

   return(
  <div>

    {
    (props.userdata).map((user)=>{
      console.log(user.id)
      console.log(user.name)
      console.log(user.email)
      console.log(user.phone)
      console.log(user.address)
      console.log(`${user.address.street},${user.address.suite},${user.address.city},${user.address.city} `)    
           })}
    <p>meet</p>
    </div>
           )
}

export default UserDatas;
